import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-login',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule
  ],
  templateUrl: 'login.component.html',
  styleUrls: [
    'login.component.scss'
  ]
})
export class LoginComponent {

}
